import { Subject } from "rxjs";
import { Produit } from "../models/produit";
import firebase from "firebase/app";
import DataSnapshot = firebase.database.DataSnapshot;

export class ProduitService{
    produits$=new Subject<Produit[]>();
    produitsList:Produit[]=[

        {name: "Chaise",
        description:["Matière : Bois","Capacité : 1 Place","Prix : 100 DT"],
        isBuyed:true,
        imgUrl: "data:image/jpeg;base64,"},

        {name: "Armoire",
        description:["Matière : Bois rouge","Capacité : 200L","Prix : 250 DT"],
        isBuyed:false,
        imgUrl:"data:image/jpeg;base64,"},

        {name: "Lit",
        description:["Matière : En Bois","Capacité : 2 Places","Prix : 300 DT"],
        isBuyed:false,
        imgUrl:"data:image/jpeg;base64,"}
      ];


      addAppareil(produit: Produit) {
        this.produitsList.push(produit);  
        this.emettreProduit();
        }
      emettreProduit(){
        this.produits$.next(this.produitsList.slice());
      }

      saveData() {
        return new Promise((resolve, reject) => {
            firebase.database().ref('produits').set(this.produitsList).then(
              (data: DataSnapshot) => {
                resolve(data);
                },
            (error) => {
              reject(error);
              }
            );
            });
        }
      retrieveData() {
          return new Promise((resolve, reject) => {
            firebase.database().ref('produits').once('value').then(
              (data: DataSnapshot) => {
                this.produitsList = data.val();
                this.emettreProduit();
                resolve('Données récupérées avec succès !');},
            (error) => {
              reject(error);}
            );
            });
        }
    
}
